import React from 'react';

class Fish extends React.Component {
  render () {
    const fish = this.props.details;
    return (
      <li className="menu-fish">
        <img src={fish.image} alt={fish.name}/>
        <h3 className="fish-name">
          {fish.name}
        </h3>
      </li>
    )
  }
}

export default Fish;
